import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";

export default function Dashboard() {
  const navigate = useNavigate();

  useEffect(() => {
    // Check if UserID is stored in localStorage (i.e., the user is logged in)
    const userId = localStorage.getItem("userId");

    if (!userId) {
      // Redirect to login if no UserID found
      navigate("/login");
    }
  }, [navigate]);

  return (
    <div>
      <center>
        <h2>Dashboard</h2>
        {/* Links to other pages */}
        <Link to="/create-form">Create Form</Link><br />
        <Link to="/edit-form">Edit Form</Link><br />
        <Link to="/share-form">Share Form</Link>
      </center>
    </div>
  );
}
